import React, { Component } from 'react';
import Header from './Header';
import Form from './Form';
import Roles from './Roles';
import RoleData from './user_roles.json'
import './../App.css';

class App extends Component {

  state = {
    items: [] 
  } 
  componentDidMount() {
      this.setState({
        items: RoleData
      }); 
      console.log(RoleData);
  }


  render() {
    return (
      <div>
        {this.state.id}
        <Header />
        <Form /> 
        <Roles />
      </div>
    );
  }
}

export default App;
